import React from 'react';
import logo from "../images/logo.jpeg";

function Header() {
  return(
    <div>
      <img
        src={ logo }
        alt="Logo Wine - O maior clube de vinhos do mundo"
        width="130px"
      />
      <label htmlFor="clube">
        <select id="clube">Clube</select>
        <select id="clube" name="soon">soon</select>
      </label>
    </div>

  );
}

export default Header;
